import React, { Component } from 'react';

export default class extends Component {
  render() {
    return <div>
      <h1>Hola mundo con next.js con platzii wuuuu1 !</h1>
      <p>devolvemos mas componentes</p>
      <img src="/kero.png" alt="kero" />
      <style jsx> {`
        h1 {
          color: red;
        }
        :global(p) {
          color: purple;
        }
        img {
          max-width: 50%;
          border-radius: 30px;
        }
      `}
      </style>
    </div>
  }
};
